import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react'
import {
  Route,
  Switch,
  Redirect,
  BrowserRouter as Router
} from 'react-router-dom'
import { Provider } from 'react-redux'
import withWidth, { isWidthDown } from '@material-ui/core/withWidth'
import configureStore from './store'
import './App.css'
import 'animate.css'
import { IntlProvider } from './utils/i18n/intlContext'
import WithRoot from './withRoot'

class App extends Component {
  render() {
    const { width } = this.props
    const { currentLang, menuToggled } = this.state
    return (
      <Provider store={store}>
          <Router>
            <Switch>
              {/* <Route path="/login" component={Login} /> */}
              <Route
                path="/login"
                render={(props) => (
                  <Login {...props} loginHandler={this.handleLogin} />
                )}
              />
              <Route
                path="/reset-password"
                // component={ResetPasswordComponent }
                render={(props) => (
                  <ResetPasswordComponent {...props} resetPageStatus />
                )}
              />
              <Route
                path="/set-new-password/token=:resetToken"
                component={RedirectPage}
              />
              {/* {loggedinStatus ? ( */}
              <Route
                path="/app/:pathId"
                render={(props) => (
                  <LoggedInPages
                    {...props}
                    menuToggle={this.menuToggle}
                    currentLang={currentLang}
                    setLangIndex={this.setLangIndex}
                    toggled={menuToggled}
                    device={width}
                    // loginHandler={this.handleLogin}
                  />
                )}
              />
              {/* ) : null} */}
              <Redirect from="/" exact to="/login" />
              <Route component={NotFound404} />
            </Switch>
          </Router>
      </Provider>
    )
  }
}

export default withWidth()(WithRoot(App))
